import React from 'react'
import {render} from 'react-dom'
import ListDetails from './list/ListDetails'
import Details from './details/AppDetails'
import ListData from './data/clients1.json'


class App extends React.Component {
	constructor (props){
		super(props)
		this.infoDetale = this.infoDetale.bind(this)
	}
	infoDetale(txtMsg){
		return(
			<div className="details">
			 {console.log(txtMsg)}
					<div>
				        <div className="avatar">
				            <div className="a_img">

				            </div>
				        </div>
				        <div className="details_info">
				            <div className="info_block">
				                <div className="i_name">{this.props}</div>
				            </div>
				            <div className="info_block">
				                <div className="text-info">Ledner, Johnson and Predovic</div>
				                <div className="text-info">Investor Functionality Coordinator</div>
				            </div>
				            <div className="info_block">
				                <div className="text-info">Gerry_Hackett77@gmail.com</div>
				                <div className="text-info">(895) 984-0132</div>
				            </div>
				            <div className="info_block">
				                <div className="text-info">1520 Zemlak Cove</div>
				                <div className="text-info">New Devon</div>
				                <div className="text-info">42586-7898</div>
				                <div className="text-info">Guinea-Bissau</div>
				            </div>
				    	</div> 
					    </div>	      
	        </div>
		);
	}
	render() {
		return(
			<div className="box-content">
				{
					ListData.map((item ,clientsInfo ,index)=>{
					return <ListDetails list={item} key = {clientsInfo} infoBack={this.infoDetale}/>
				})}
			</div>

		)
	}
}
const app = document.getElementById("list")
render(<App/>, app);


class AppDetails extends React.Component {
	render() {
		return(
			<Details />
		)
	}
}
const details = document.getElementById("details")
render(<AppDetails />, details);
